import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";
import Login from "./Login";
import SNMP from "./WebSocketComponent";
import DeviceAdd from "./DeviceAdd";
import DeviceList from "./DeviceList";

const App = () => {
    const isLoggedIn = !!localStorage.getItem("token"); // Giriş kontrolü

    return (
        <Router>
            <div style={{ display: "flex", height: "100vh" }}>
                {/* Logout Butonu (Sağ Üstte) */}
                {isLoggedIn && (
                    <button
                        onClick={() => {
                            localStorage.removeItem("token"); // Token'ı kaldır
                            window.location.href = "/login"; // Login sayfasına yönlendir
                        }}
                        style={{
                            position: "fixed",
                            top: "10px",
                            right: "10px",
                            background: "#e74c3c",
                            color: "#fff",
                            border: "none",
                            padding: "10px 15px",
                            cursor: "pointer",
                            borderRadius: "5px",
                            zIndex: "1000",
                        }}
                    >
                        Logout
                    </button>
                )}

                {/* Sol Menü */}
                {isLoggedIn && (
                    <nav
                        style={{
                            width: "200px",
                            background: "#f4f4f4",
                            padding: "20px",
                            boxShadow: "2px 0 5px rgba(0, 0, 0, 0.1)",
                            position: "fixed",
                            height: "100%",
                        }}
                    >
                        <h3 style={{ textAlign: "center", marginBottom: "20px", color: "#333" }}>
                            Menu
                        </h3>
                        <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
                            <li style={{ marginBottom: "15px" }}>
                                <Link to="/snmp" style={menuLinkStyle}>
                                    SNMP Communication
                                </Link>
                            </li>
                            <li style={{ marginBottom: "15px" }}>
                                <Link to="/add-device" style={menuLinkStyle}>
                                    Add Device
                                </Link>
                            </li>
                            <li style={{ marginBottom: "15px" }}>
                                <Link to="/device-list" style={menuLinkStyle}>
                                    Device List
                                </Link>
                            </li>
                        </ul>
                    </nav>
                )}

                {/* Sayfa İçeriği */}
                <div style={{ flex: 1, padding: "20px", marginLeft: isLoggedIn ? "200px" : "0" }}>
                    <Routes>
                        <Route path="/login" element={<Login />} />
                        <Route path="/snmp" element={isLoggedIn ? <SNMP /> : <Navigate to="/login" />} />
                        <Route path="/add-device" element={isLoggedIn ? <DeviceAdd /> : <Navigate to="/login" />} />
                        <Route path="/device-list" element={isLoggedIn ? <DeviceList /> : <Navigate to="/login" />} />
                        <Route path="/" element={<Navigate to={isLoggedIn ? "/snmp" : "/login"} />} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
};

// Sol menü linkleri için ortak stil
const menuLinkStyle = {
    textDecoration: "none",
    color: "#333",
    padding: "10px 15px",
    display: "block",
    borderRadius: "5px",
    background: "#f8f9fa",
    transition: "all 0.3s ease",
};

// Hover efekti
menuLinkStyle[":hover"] = {
    background: "#e9ecef",
    color: "#000",
};

export default App;
